import jwt from "jsonwebtoken";
import { authJwt } from "../config.js";

const TOKEN_SECRET = authJwt.jwtSecret;

export function createAccessToken(payload) {
  return new Promise((resolve, reject) => {
    jwt.sign(
      payload,
      TOKEN_SECRET,
      {
        expiresIn: "1d",
      },
      (err, token) => {
        if (err) reject(err);
        resolve(token);
      }
    );
  });
}

