import { Router } from "express";
import { authRequired } from "../middlewares/validateToken.js";
import {
  createLog,
  getLog,
} from "../controllers/log.controller.js";

const router = Router();

/**
 * @swagger
 * tags:
 *  name: Log
 *  description: Log management
 */

/**
 * @swagger
